    false,nt"url": null,nt"notes": "Pressure gauge and other data were collected
    from a fixed platform from 05 November 1975 to 27 September 1976. Data were collected
    by the Pacific Marine Environmental Laboratory (PMEL) as part of the Outer Continental
    Shelf Environmental Assessment Program (OCSEAP). Data were processed by NODC to
    the NODC standard F017 Pressure Gauge Data format. Full format description is available
    from NODC at www.nodc.noaa.gov/General/NODC-Archive/f017.html. An analog file for
    this accession is available from NODC user services.nnThe F017 format contains time
    series measurements of seawater pressure from anchored or bottom-mounted sensors.
    Measurements of variations at depth of seawater pressure provide information on
    tidal and storm flows, ocean circulation, and other phenomena that cause changes
    in sea surface elevation or slope and that can be detected from their pressure signature.
    Position, bottom depth, and gauge depth are reported for each station. The data
    record comprises values of total pressure at specified date and time. Data values
    may be subject to averaging or filtering and are typically reported at time intervals
    of 10-15 minutes. Seawater temperature may also be reported. Comments may be reported
    in a text record.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
